import React, { Component } from "react";
import { Jumbotron, Button, Container } from "reactstrap";

class PageHeader extends Component {
  render() {
    return (
      <Jumbotron>
        <Container>
          <h1 className="display-3">Data Generation Tool</h1>
          <hr className="my-2" />
          <p>
            Use this tool to generate test data tailored to your specifications.
          </p>{" "}
          <br />{" "}
          <p>
            {" "}
            Select the quantity and options for the data you would like to
            generate below. You may recieve this data in csv, excel or json
            format.
          </p>
          <br />
          <Button color="primary">Our GitHub Repo</Button>
        </Container>
      </Jumbotron>
    );
  }
}

export default PageHeader;
